import React,{useEffect,useState} from 'react'

const Post = () => {
    const[post, setpost]=useState()
    useEffect(() => {
        const url="https://jsonplaceholder.typicode.com/posts"
        fetch(url)
        .then(response=>response.json())
        .then(response=>console.log(response))
    }, [])
    return (
        <div>
            <h1>Post import</h1>
        </div>
    )
}

export default Post
